import styled from "styled-components";

export const Container = styled.footer`
    height: 5.625rem;
    width: 100%;
    background-color: blue;
    position: absolute;
    bottom: 0;
    z-index: 2;
    display: flex;
    justify-content: space-between;
    padding: 0 8%;

    p {
        color: white;
        font-size: 18px;
    }

    a {
        text-decoration: none;
        color: white;
        font-size: 18px;
    }
`;
